import React from "react";

function Header() {
	return (
		<header>
          <div class="container">
              <div class="intro-text">
                  <div class="intro-heading">Hello mi nombre es Daniel Prisco</div>
                  <div class="intro-heading">Soy nuevo en la programación y diseño web</div>
				  <div class="intro-lead-in">Python • C++ • Java • SQL • JavaScript • CSS • HTML</div>
              </div>
           </div>
        </header>
	)
}
      
export default Header;
